    false,nt"url": null,nt"notes": "This dataset contains borehole temperature
    observation data compiled by the Wyoming Geological Survey, and published as a Web
    feature service for the National Geothermal Data System. This dataset includes data
    from both year 1 and year 3 submissions, from both the Wyoming Geological Survey
    and data from an AAPG publication compiled by Richard W. Davis.  See author information
    (below) for details.  Fields in the Borehole Temperature Observation Content Model
    will become XML elements in interchange documents for WMS simple features provided
    by a node in the USGIN network. Each feature includes a label, drilled depth (if
    available), measured temperature and source. The dataset is spatially referenced
    to EPSG: 4326 (for interoperability). The data contained in the submitted dataset
    is available as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to
    Borehole Temperature Observation Content Model: <html>http://stategeothermaldata.org/data_delivery/content_models/borehole_temperature_observation<html>.",nt"license_title":
